import React from 'react'
import { DataGrid } from '@material-ui/data-grid';
import { DeleteOutline } from '@material-ui/icons';
import { Link} from 'react-router-dom'
import './userList.css'

export default function UserList() {

    const columns = [
        { 
            field: 'id', 
            headerName: 'ID', 
            width: 90 
        },
        {
          field: 'avatar',
          headerName: 'Avatar',
          width: 200,
          renderCell: (params) => {
              return(
                  <div className='userListUser'>
                      <img className='userListImg' src={params.row.avatar} alt=''/>
                        {params.row.usuario}
                  </div>
              )
          }
        },
        {
          field: 'correo',
          headerName: 'Correo',
          width: 200,
          editable: true,
        },
        {
            field: 'rut',
            headerName: 'Rut',
            width: 110,
            editable: true,
          },
          {
            field: 'status',
            headerName: 'Status',
            width: 150,
            editable: true,
          },
          {
            field: 'accion',
            headerName: 'Accion',
            width: 150,
            renderCell: (params)=>{
                return(
                    <>
                    <Link to={"/user/"+params.row.id}>
                        <button className='userListEdit'>
                            Editar
                        </button>
                    </Link>
                    <DeleteOutline className='userListDelete'/>
                    </>
                )
            }
          }
      ];

      const rows = [
        { id: 1, usuario: 'alex', avatar: 'https://i.ibb.co/BqP759M/icono-de-la-muestra-del-usuario-si-mbolo-de-la-persona-avatar-humano-84531334.jpg', correo: 'alelias@gmail.com', rut: '23.342.223-4', status: 'activo'  },
        { id: 2, usuario: 'carla', avatar: 'https://i.ibb.co/BqP759M/icono-de-la-muestra-del-usuario-si-mbolo-de-la-persona-avatar-humano-84531334.jpg', correo: 'alelias@gmail.com', rut: '23.342.223-4', status: 'activo' },
        { id: 3, usuario: 'leyla', avatar: 'https://i.ibb.co/BqP759M/icono-de-la-muestra-del-usuario-si-mbolo-de-la-persona-avatar-humano-84531334.jpg', correo: 'alelias@gmail.com', rut: '23.342.223-4', status: 'activo' },

      ];

    return (
        <div className='userList'>
            <DataGrid
                rows={rows}
                columns={columns}
                pageSize={5}
                checkboxSelection
                disableSelectionOnClick
            />
        </div>
    )
}
